import LevelBuilderfrom sprites import *def render(name,bg):	lb = LevelBuilder.LevelBuilder(name+".plist",background=bg)	lb.addObject(Rotor.RotorSprite(x=224,y=253,speed=2,angle=0,torque=1000))	lb.addObject(Hero.HeroSprite(x=199, y=230,width=32,height=32))	lb.addObject(Star.StarSprite(x=258, y=193,width=32,height=32))	lb.addObject(Beam.BeamSprite(x=335, y=-18,width=453,height=159,angle='30',restitution=1,static='true',friction=0.5,density=20 ).setName('Beam'))	lb.addObject(Friend.FriendSprite(x=246, y=274,width=26,height=26,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(Joints.DistanceJoint(body1='Hero',body2='Friend',damping='0.2',freq='20' ))	lb.addObject(Enemy.EnemySprite(x=248, y=229,width=32,height=32,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(SpikeyBuddy.SpikeyBuddySprite(x=202, y=272,width=23,height=23,restitution=0.2,static='false',friction=0.5,density=20 ).setName('Spikey'))	lb.addObject(Joints.DistanceJoint(body1='Enemy',body2='Spikey',damping='0.2',freq='20' ))	lb.addObject(Nut.NutSprite(x=459, y=171,width=13,height=13,eventName='onNutHit' ,restitution=0.2,static='true',friction=0.5,density=20 ).setName('Nut'))	lb.addObject(Joints.DistanceJoint(body1='Nut',body2='Star',damping='0',freq='20' ))	lb.render()